import { IonItem, IonList, IonTitle, IonToolbar } from "@ionic/react";


const Gasto:React.FC = () => { 

    return (<>
        <IonToolbar>
            <IonTitle>Menus </IonTitle>
        </IonToolbar>

        <IonList>
            <IonItem routerLink='Page/Gastos/lista'>Lista Gatos</IonItem>
            <IonItem routerLink='/nuevo'>Nuevo Gasto</IonItem>
            <IonItem>Tipos de Gastos</IonItem>
        </IonList>
    </>);
}

export default Gasto;
